from timeit import default_timer as timer

str1 = ""
str2 = ""
k=3


def repVector(string):
  n = len(string)
  repVec = []
  stat = 0
  for i in range(n):
    if i < k-1:
      repVec.append("1"*(i+1) + "0"*(k-(i+1)))
    elif i > n-k:
      repVec.append("0"*(i-stat)+"1"*(k-(i-stat)))
    else:
      stat = i
      repVec.append("1"*k)
  return repVec


def HashMap(string,repVec):
  dictionary = {}
  for i,ele in enumerate(string):
    
      if not ele in dictionary:
        dictionary[ele] = [repVec[i]]
      else:
        dictionary[ele].append(repVec[i])

  return dictionary


def matchScore(hm1, hm2, sum=0):
  start = timer()
  for key,val in hm1.items():
    if key in hm2:
      for klet in val:
        for klat in hm2[key]:

          str1b = int(klet, 2)
          str2b = int(klat, 2)
          bitwise_and_result = str1b & str2b

          sum += (str(bin(bitwise_and_result)).count("1"))

  end = timer()
  print(f'Proccess executed in {end - start} seconds') 
  return sum
            

                

rep = repVector(str1)
hashM1 = HashMap(str1,rep)
hashM2 = HashMap(str2,rep)
match_score = matchScore(hashM1, hashM2)
print(match_score, "matches found")
